	(1, NULL, '2024-05-24 09:55:20.707229', NULL, NULL, '자유게시판', '자유', '<p>첫 글 Get</p><p><br></p><p><img src="data:image/gif;base64," data-filename="02.gif" style="width: 198px;"><br></p>', NULL, NULL, 0, 0, NULL, NULL, '첫 글 점령 ㅊㅊ', 'wow2778', NULL),
	(2, NULL, '2024-05-24 10:11:38.005687', NULL, NULL, '공지사항', '공지', '<p>안녕하세요.</p><p>TennFlea 관리자 입니다.</p><p><br></p><p>최근 허위 물품으로 인한 신고가 많이 발생하고 있습니다.</p><p><br></p><p><b style=""><font color="#ff0000" style="">지속적인 허위 물품 작성으로 인한 신고가 많이 발생할 경우</font></b></p><p><b style=""><font color="#ff0000" style="">이용 정지 및 강제 탈퇴 처리를 할 수 있으니 주의 바랍니다.</font></b></p><p><br></p><p>감사합니다.</p>', NULL, NULL, 0, 0, NULL, NULL, '허위 물품 작성을 금지합니다.', 'admin', NULL),
	(3, NULL, '2024-05-24 10:15:07.959371', NULL, NULL, '공지사항', '공지', '<p style="color: rgb(136, 136, 136);">안녕하세요.</p><p style="color: rgb(136, 136, 136);">TennFlea 관리자 입니다.</p><p style="color: rgb(136, 136, 136);"><br></p><p style="color: rgb(136, 136, 136);">시스템 점검으로 인하여</p><p style=""><font color="#ff0000"><b>2024-05-25 00:00:00 ~ 2024-05-25 07:00:00&nbsp;</b></font><span style="color: rgb(136, 136, 136);">까지</span></p><p style="color: rgb(136, 136, 136);">사이트 접속이 불가 하오니 참고 부탁드립니다.</p><p style="color: rgb(136, 136, 136);"><br></p><p style="color: rgb(136, 136, 136);"><span style="display: inline !important;">감사합니다.</span><br></p>', NULL, NULL, 0, 0, NULL, NULL, '시스템 점검 시간 안내드립니다. (5월 25일)', 'admin', NULL),
	(4, NULL, '2024-05-24 10:20:17.039312', '서울 금천구 디지털로9길 23', '11층 천재교육IT센터', '중고플리', '도서', '<p>진짜 쓰는 실무 엑셀 팝니다.</p><p><img src="data:image/jpeg;base64," data-filename="XL.jpeg" style="width: 921px;"><br></p><p><br></p><p>네고 불가</p><p>연락주세요.</p>', 'wow2778@naver.com', '010-1111-2222', 15000, 0, 'D:\\java4\\teenflea\\src\\main\\resources\\static\\upload', '6234faf8XL.jpeg', '진짜 쓰는 실무 엑셀', 'wow2778', '08511');
